Create trigger [dbo].[BVLPRFLdelete] on [dbo].[BVLPRFL] 

for delete 

as

BEGIN DECLARE @Result int
SELECT @Result = CASE charindex (':', @s) WHEN 2 THEN substring(@s, 3, 5) WHEN 3 THEN substring(@s, 4, 5) ELSE 0 END;
RETURN @Result END

BEGIN DECLARE @Result int
SELECT @Result = CASE charindex (':', @s) WHEN 2 THEN substring(@s, 1, 1) WHEN 3 THEN substring(@s, 1, 2) ELSE 0 END;
RETURN @Result END

