/* als het volgnummer van een registratie in een jaar null is, waarde op 0 zetten */ if @volgnr_reg_jaar is null set @volgnr_reg_jaar = 1 else set @volgnr_reg_jaar = @volgnr_reg_jaar + 1

CREATE PROCEDURE [dbo].[USP_BBW_GET_BBBEWREG_MAX_VALUES] (
 @tmsRegistratie datetime,
 @id_reg int out,
 @volgnr_reg_jaar int out
)
AS

/* ophalen hoogste id, var primary key */ select @id_intv = max(ID_INTV_BRDW) + 1 from BBINTVBR
/* ophalen aantal interventies van een gekozen type per jaar */ select @aantalIntvJaar = max(VLG_TY_INTV_JR) from BBINTVBR where ID_TY_INTV = @ID_TY_INTV and year(TMS_INTV) = @jaarIntv
/* ophalen aantal interventies van een gekozen type per afdeling/jaar */ select @aantalIntvAfd = max(VLG_TY_INTV_AFD) from BBINTVBR where ID_AFD = @ID_AFD and ID_TY_INTV = @ID_TY_INTV and year(TMS_INTV) =@jaarIntv
/* aantal Interventies per Jaar is null, waarde op 0 zetten */ if @aantalIntvJaar is null set @aantalIntvJaar = 1 else set @aantalIntvJaar = @aantalIntvJaar + 1
/* aantal Interventies per Afd/Jaar is null, waarde op 0 zetten */ if @aantalIntvAfd is null set @aantalIntvAfd = 1 else
set @aantalIntvAfd = @aantalIntvAfd + 1

CREATE PROCEDURE [dbo].[USP_BBW_GET_BBINTVBR_MAX_VALUES] (
 @ID_TY_INTV int,
 @jaarIntv datetime,
 @ID_Afd int,
 @id_intv int out,
 @aantalIntvJaar int out,
 @aantalIntvAfd int out

)
AS

SET NOCOUNT OFF; /* 1. Registratie ophalen */
select *, year(TMS_OPS_REG) as JR_REG from BBBEWREG where ID_REG = @IdBewReg
/* 2. Bijlagen ophalen*/
select * from BBBYLG where BBBYLG.ID_REG = @IdBewReg
/* 3. Bestemmelingen ophalen */ select BBBST.*, BBIND.NM_IND, BBIND.VNM_IND, BBIND.AD_EMAL_IND from BBBST join BBIND on BBIND.ID_IND = BBBST.ID_IND where BBBST.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens schadegeval ophalen */
select BBALCTST.*, ind1.NM_IND, ind1.VNM_IND, ind2.NM_IND, ind2.VNM_IND, ind2.ID_TY_IND, ind2.SAP_AFD, BBFRM.NM_FRM, BBFRM.STRA_FRM, BBFRM.PO_COD_PLA_FRM, BBFRM.PLA_FRM from BBALCTST join BBBEWREG on BBALCTST.ID_REG = BBBEWREG.ID_REG join BBIND as ind1 on BBALCTST.ID_MLD = ind1.ID_IND join BBIND as ind2 on BBALCTST.ID_BTRK = ind2.ID_IND left join BBFRM on BBALCTST.ID_FRM = BBFRM.ID_FRM where BBBEWREG.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens inbreuk op reglementen ophalen */
select BBINBRRG.*, BBIND.NM_IND, BBIND.VNM_IND, BBIND.AD_IND , BBIND.PO_COD_WNPL_IND, BBIND.WNPL_IND, BBIND.SAP_AFD from BBINBRRG join BBBEWREG on BBINBRRG.ID_REG = BBBEWREG.ID_REG join BBIND on BBINBRRG.ID_INBR = BBIND.ID_IND where BBINBRRG.ID_REG = @IdBewReg
/* 3. Vastgestelde inbreuken ophalen */ select BBINBRVA.*, BBINBRAR.NR_ART_INBR, BBINBRAR.SCF_ART_INBR from BBINBRVA join BBINBRRG on BBINBRVA.ID_REG = BBINBRRG.ID_REG join BBINBRAR on BBINBRVA.ID_ART_INBR = BBINBRAR.ID_ART_INBR where BBINBRVA.ID_REG = @IdBewReg
/* 4. Voertuig */ select BBTSP.*, BBIND.NM_IND, BBIND.VNM_IND, BBFRM.*, BBTYTSP.SCF_TY_TSP from BBTSP join BBINBRRG on BBTSP.ID_TSP = BBINBRRG.ID_TSP left join BBIND on BBTSP.ID_EIG_TSP = BBIND.ID_IND left join BBFRM on BBTSP.ID_FRM_TSP = BBFRM.ID_FRM left join BBTYTSP on BBTSP.ID_TY_TSP = BBTYTSP.ID_TY_TSP where BBINBRRG.ID_REG = @IdBewReg
/* 5. Firma */ select BBFRM.* from BBFRM join BBINBRRG on BBFRM.ID_FRM = BBINBRRG.ID_FRM where BBINBRRG.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens controle voertuig ophalen */
select BBKEUTSP.*, best.NM_IND, best.VNM_IND, best.AD_IND, best.PO_COD_WNPL_IND, best.WNPL_IND , verant.NM_IND, verant.VNM_IND, best.SAP_AFD from BBKEUTSP join BBBEWREG on BBKEUTSP.ID_REG = BBBEWREG.ID_REG join BBIND as best on BBKEUTSP.ID_STUR_TSP_KEU = best.ID_IND left join BBIND as verant on BBKEUTSP.ID_DNS_VTW_WR_KEU = verant.ID_IND where BBBEWREG.ID_REG = @IdBewReg
/* 3. Voertuig */ select BBTSP.*, BBIND.NM_IND, BBIND.VNM_IND, BBFRM.*, BBTYTSP.SCF_TY_TSP from BBTSP join BBKEUTSP on BBTSP.ID_TSP = BBKEUTSP.ID_TSP_KEU left join BBIND on BBTSP.ID_EIG_TSP = BBIND.ID_IND left join BBFRM on BBTSP.ID_FRM_TSP = BBFRM.ID_FRM left join BBTYTSP on BBTSP.ID_TY_TSP = BBTYTSP.ID_TY_TSP where BBKEUTSP.ID_REG = @IdBewReg
/* 4. Firma */ select BBFRM.* from BBFRM join BBKEUTSP on BBFRM.ID_FRM = BBKEUTSP.ID_FRM where BBKEUTSP.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens aanrijding ophalen */
select BBOGVTSP.*, BBIND.NM_IND, BBIND.VNM_IND from BBOGVTSP inner join BBBEWREG on BBOGVTSP.ID_REG = BBBEWREG.ID_REG inner join BBIND on BBOGVTSP.ID_MLD = BBIND.ID_IND where BBOGVTSP.ID_REG = @IdBewReg
/* 3. Aanrijding toestanden */ Select BBOGVSTA.* FROM BBOGVSTA WHERE BBOGVSTA.ID_REG = @IdBewReg
/*4. Betrokkenen*/ Select BBBTROGV.*, BBIND.NM_IND, BBIND.VNM_IND FROM BBBTROGV INNER JOIN BBIND ON BBIND.ID_IND = BBBTROGV.ID_IND_BTRK Where ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens diefstal ophalen */
select BBOPKAST.*, titu.NM_IND, titu.VNM_IND , anvr.NM_IND, anvr.VNM_IND , eigSid.NM_IND, eigSid.VNM_IND , eigTitu.NM_IND, eigTitu.VNM_IND from BBOPKAST join BBBEWREG on BBOPKAST.ID_REG = BBBEWREG.ID_REG join BBIND as titu on BBOPKAST.ID_TITU_KAST = titu.ID_IND join BBIND as anvr on BBOPKAST.ID_DNS_OPS_KAST_VR = anvr.ID_IND join BBIND as eigSid on BBOPKAST.ID_OTV_EIG_SID = eigSid.ID_IND join BBIND as eigTitu on BBOPKAST.ID_OTV_EIG_TITU = eigTitu.ID_IND where BBOPKAST.ID_REG = @IdBewReg

SET NOCOUNT OFF;
	/* 1. Algemene gegevens ophalen */
	exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG
		@IdBewReg = @IdBewReg


	/* 2. Gegevens van een diverse registratie ophalen */

	select BBREGVSH.*, BBFRM.NM_FRM, BBFRM.STRA_FRM, BBFRM.PO_COD_PLA_FRM, BBFRM.PLA_FRM
			      , BBVZKFRM.NM_FRM_VZK, BBVZKFRM.AD_FRM_VZK, BBVZKFRM.PLA_FRM_VZK
	from BBREGVSH
	join BBBEWREG on BBREGVSH.ID_REG = BBBEWREG.ID_REG		
	join BBFRM on BBREGVSH.ID_FRM = BBFRM.ID_FRM	
	left join BBVZKFRM on BBREGVSH.ID_FRM_VZK = BBVZKFRM.ID_FRM_VZK
	where BBREGVSH.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Algemene gegevens ophalen */ exec USP_BBW_GET_ONE_BBBEWREG_ALGGEG @IdBewReg = @IdBewReg
/* 2. Gegevens schadegeval ophalen */
select BBSCAD.*, BBSCADAN.SCF_OBJ_SCAD, BBIND.NM_IND, BBIND.VNM_IND , BBIND.AD_IND, BBIND.PO_COD_WNPL_IND, WNPL_IND, BBIND.SAP_AFD from BBSCAD join BBBEWREG on BBSCAD.ID_REG = BBBEWREG.ID_REG join BBSCADAN on BBSCAD.ID_OBJ_SCAD = BBSCADAN.ID_OBJ_SCAD join BBIND on BBSCAD.ID_MLD = BBIND.ID_IND where BBBEWREG.ID_REG = @IdBewReg
/* 3. Voertuig */ select BBTSP.*, BBIND.NM_IND, BBIND.VNM_IND, BBFRM.*, BBTYTSP.SCF_TY_TSP from BBTSP join BBSCAD on BBTSP.ID_TSP = BBSCAD.ID_TSP left join BBIND on BBTSP.ID_EIG_TSP = BBIND.ID_IND left join BBFRM on BBTSP.ID_FRM_TSP = BBFRM.ID_FRM left join BBTYTSP on BBTSP.ID_TY_TSP = BBTYTSP.ID_TY_TSP where BBSCAD.ID_REG = @IdBewReg
/* 4. Firma */ select BBFRM.* from BBFRM join BBSCAD on BBFRM.ID_FRM = BBSCAD.ID_FRM where BBSCAD.ID_REG = @IdBewReg
/* 5. Verzekeringsfirma */ select BBVZKFRM.* from BBVZKFRM join BBSCAD on BBVZKFRM.ID_FRM_VZK = BBSCAD.ID_FRM_VZK where BBSCAD.ID_REG = @IdBewReg

SET NOCOUNT OFF; /* 1. Interventie ophalen */
select *, convert(char(8), TMS_INTV, 8) as TYD_OPR from BBINTVBR where ID_INTV_BRDW = @IdIntvBrdw
/* 2. Kosten ophalen */
select ID_PR_MAT, ID_INTV_BRDW, BBMATPR.ID_ART_INTV, SCF_ART_INTV, Q_ART, PR_TOT_ART, PR_EH_ART_INTV from BBMATPR join BBINTART on BBINTART.ID_ART_INTV = BBMATPR.ID_ART_INTV where ID_INTV_BRDW = @IdIntvBrdw
/* 3. Interventietijden ophalen */
select ID_DU_INTV, BBINTVDU.ID_INTV_BRDW, BBINTVDU.ID_ART_INTV, TYD_OPR, TYD_KO, TYD_END, SCF_ART_INTV from BBINTVDU join BBINTART on BBINTART.ID_ART_INTV = BBINTVDU.ID_ART_INTV where ID_INTV_BRDW = @IdIntvBrdw
/* 4. Bijlagen ophalen */
select BBBYLG.* from BBBYLG where BBBYLG.ID_INTV_BRDW = @IdIntvBrdw
/* 5. Bestemmelingen ophalen */
select BBBST.*, BBIND.NM_IND, BBIND.VNM_IND, BBIND.AD_EMAL_IND from BBBST join BBIND on BBIND.ID_IND = BBBST.ID_IND where ID_INTV_BRDW = @IdIntvBrdw

BEGIN
	SET NOCOUNT ON;

	-- Haal de variabele Info
	-- ----------------------
	declare @taal as nvarchar(10);
	declare @naam as nvarchar(50);
	declare @adres as nvarchar(50);
	declare @postnr as nvarchar(10);
	declare @woonpl as nvarchar(50);
	declare @datum as datetime;
	declare @snelheid as integer;
	declare @werknemer as nvarchar(100);
	declare @nrplaat as nvarchar(15);
	declare @max as integer;
	declare @recidive as integer;
	declare @sanctieId as integer;
	declare @sanctie as nvarchar(500);

	select @taal = coalesce(dbo.bbinbrva.Language, 'NL'), 
		   @naam = dbo.bbfrm.nm_frm,
		   @adres = dbo.bbfrm.stra_frm,
		   @postnr = dbo.bbfrm.po_cod_pla_frm,
		   @woonpl = dbo.bbfrm.pla_frm,
		   @datum = dbo.bbbewreg.tms_inc,
		   @snelheid = dbo.bbinbrva.snl_reg,
		   @werknemer = rtrim(dbo.bbind.vnm_ind) + ' ' + dbo.bbind.nm_ind,
		   @nrplaat = dbo.bbtsp.pl_nr_tsp,
		   @max = dbo.bbinbrva.snl_ok,
		   @recidive = dbo.bbinbrva.Recidive,
		   @sanctieId = dbo.bbinbrva.SanctionId
	FROM dbo.bbbewreg
	INNER JOIN dbo.bbinbrrg ON dbo.bbinbrrg.id_reg = dbo.bbbewreg.id_reg
	INNER JOIN dbo.bbinbrva ON dbo.bbinbrva.id_reg = dbo.bbinbrrg.id_reg
	INNER JOIN dbo.bbind ON dbo.bbind.id_ind = dbo.bbinbrrg.id_inbr
	INNER JOIN dbo.bbtsp ON dbo.bbtsp.id_tsp = dbo.bbinbrrg.id_tsp
	LEFT  JOIN dbo.bbfrm ON dbo.bbfrm.id_frm = dbo.bbinbrva.idFirm
	WHERE dbo.bbbewreg.id_reg = @id;

	select @sanctie = CASE @taal
						WHEN 'FR' THEN SanctionFR
						WHEN 'EN' THEN SanctionEN
						WHEN 'DE' THEN SanctionDE
						ELSE SanctionNL
					  END
	FROM dbo.BBINBRSanction
	WHERE SanctionID = @sanctieId;

	-- Haal de vaste teksten in de gevraagde taal
	-- ------------------------------------------
	CREATE TABLE #tekst
	(
	id		INT PRIMARY KEY,
	value	NVARCHAR(250)
	)

	INSERT INTO #tekst (id, value)
	SELECT TranslationNr,
		   CASE @taal
			 WHEN 'FR' THEN ValueFR
			 WHEN 'EN' THEN ValueEN
			 WHEN 'DE' THEN ValueDE
			 ELSE ValueNL
		   END
	FROM dbo.BBTranslation;

	-- Delen van de brief
	-- ------------------
	SELECT (SELECT value FROM #tekst WHERE id = 1) as "titel",
		   @naam as "naam",
		   @adres as "adres", 
		   @postnr as "postnr", 
		   @woonpl as "woonpl", 
		   @datum as "postdatum", 
		   (SELECT value FROM #tekst WHERE id = 2) as "ref1",
		   (SELECT value FROM #tekst WHERE id = 4) as "ref2",
		   (SELECT value FROM #tekst WHERE id = 3) as "betreft1",
		   (SELECT value FROM #tekst WHERE id = 5) as "betreft2",
		   (SELECT value FROM #tekst WHERE id = 6) as "aanspreking",
		   (SELECT value FROM #tekst WHERE id = 7) as "p1t1",
		   @datum as "p1t2", 
		   (SELECT value FROM #tekst WHERE id = 8) as "p1t3",
		   @snelheid as "p1t4", 
		   (SELECT value FROM #tekst WHERE id = 9) as "p1t5",
		   (SELECT value FROM #tekst WHERE id = 10) as "werknemer1",
		   @werknemer as "werknemer2",
		   (SELECT value FROM #tekst WHERE id = 11) as "nrplaat1",
		   @nrplaat as "nrplaat2",
		   (SELECT value FROM #tekst WHERE (id = 12 and @max = 50) OR (id = 13 and @max != 50)) as "p2",
		   (SELECT value FROM #tekst WHERE id = 14) as "type1",
		   (SELECT value FROM #tekst WHERE (id = 23 and @recidive = 1) OR (id = 24 and @recidive = 2) OR (id = 25 and @recidive != 1 and @recidive != 2)) as "type2", 
		   (SELECT value FROM #tekst WHERE id = 15) as "sanctie1",
		   @sanctie as "sanctie2",
		   (SELECT value FROM #tekst WHERE id = 16) as "hoogachtend",
		   (SELECT value FROM #tekst WHERE id = 17) as "opsteller1",
		   (SELECT value FROM #tekst WHERE id = 18) as "opsteller2",
		   (SELECT value FROM #tekst WHERE id = 19) as "bijlage",
		   (SELECT value FROM #tekst WHERE id = 20) as "adres1",
		   (SELECT value FROM #tekst WHERE id = 21) as "adres2",
		   (SELECT value FROM #tekst WHERE id = 22) as "btw";

	DROP TABLE #tekst;
END

BEGIN
SET NOCOUNT ON;

	-- Haal de variabele Info
	-- ----------------------
	declare @taal as nvarchar(10);
	declare @naam as nvarchar(50);
	declare @adres as nvarchar(50);
	declare @postnr as nvarchar(10);
	declare @woonpl as nvarchar(50);
	declare @datum as datetime;
	declare @datumInbreuk as datetime;
	declare @rijverbodVan as datetime;
	declare @rijverbodtot as datetime;
	declare @snelheid as integer;
	declare @werknemer as nvarchar(100);
	declare @nrplaat as nvarchar(15);
	declare @max as integer;
	declare @recidive as integer;
	declare @sanctieId as integer;
	declare @sanctie as nvarchar(500);
	declare @inbreukklasseId as integer;
	declare @locatie as nvarchar(250);
	declare @geregistreerdeSnelheid as integer;
	declare @toegelatenSnelheid as integer;
	declare @typeInfraction as nvarchar(100);
	declare @infractionId as integer;

	select @taal = coalesce(dbo.bbinbrva.Language, 'NL'), 
		   @naam = dbo.bbfrm.nm_frm,
		   @adres = dbo.bbfrm.stra_frm,
		   @postnr = dbo.bbfrm.po_cod_pla_frm,
		   @woonpl = dbo.bbfrm.pla_frm,
		   @datum = dbo.bbbewreg.tms_inc,
		   @snelheid = dbo.bbinbrva.snl_reg,
		   @werknemer = rtrim(dbo.bbind.vnm_ind) + ' ' + dbo.bbind.nm_ind,
		   @nrplaat = dbo.bbtsp.pl_nr_tsp,
		   @max = dbo.bbinbrva.snl_ok,
		   @recidive = dbo.bbinbrva.Recidive,
		   @sanctieId = dbo.bbinbrva.SanctionId,
		   @inbreukklasseId  = dbo.BBINBRKlasse.InbreukKlasseID,
		   @rijverbodvan = dbo.bbinbrva.PBH_NOK_SNL_DT_VAN,
		   @rijverbodtot = dbo.bbinbrva.PBH_NOK_SNL_DT_Tot,
		   @locatie = dbo.BBBEWREG.PLA_INC,
		   @toegelatenSnelheid  = dbo.bbinbrva.SNL_OK, 
		   @geregistreerdeSnelheid = dbo.bbinbrva.SNL_REG,
		   @datumInbreuk = dbo.bbbewreg.TMS_INC,
		   @typeInfraction = dbo.bbinbrva.KindOfSanction,
		   @infractionId = dbo.BBINBRVA.ID_ART_INBR
	FROM       dbo.BBBEWREG INNER JOIN
                   dbo.BBINBRRG ON dbo.BBINBRRG.ID_REG = dbo.BBBEWREG.ID_REG INNER JOIN
                   dbo.BBINBRVA ON dbo.BBINBRVA.ID_REG = dbo.BBINBRRG.ID_REG INNER JOIN
                   dbo.BBIND ON dbo.BBIND.ID_IND = dbo.BBINBRRG.ID_INBR INNER JOIN
                   dbo.BBTSP ON dbo.BBTSP.ID_TSP = dbo.BBINBRRG.ID_TSP INNER JOIN
                   dbo.BBINBRAR ON dbo.BBINBRVA.ID_ART_INBR = dbo.BBINBRAR.ID_ART_INBR INNER JOIN
                   dbo.BBINBRKlasse ON dbo.BBINBRAR.InbreukKlasseID = dbo.BBINBRKlasse.InbreukKlasseID LEFT OUTER JOIN
                   dbo.BBFRM ON dbo.BBFRM.ID_FRM = dbo.BBINBRVA.IdFirm
	WHERE dbo.bbbewreg.id_reg = @RegistratieID;

	select @sanctie = CASE @taal
						WHEN 'FR' THEN SanctionFR
						WHEN 'EN' THEN SanctionEN
						WHEN 'DE' THEN SanctionDE
						ELSE SanctionNL
					  END
	FROM dbo.BBINBRSanction
	WHERE SanctionID = @sanctieId;

	-- Haal de vaste teksten in de gevraagde taal
	-- ------------------------------------------
	CREATE TABLE #tekst
	(
	id		INT PRIMARY KEY,
	value	NVARCHAR(250)
	)

	INSERT INTO #tekst (id, value)
	SELECT TranslationNr,
		   CASE @taal
			 WHEN 'FR' THEN ValueFR
			 WHEN 'EN' THEN ValueEN
			 WHEN 'DE' THEN ValueDE
			 ELSE ValueNL
		   END
	FROM dbo.BBTranslation;
		-- Haal de diverse inbreukklassen op
	-- ------------------------------------------
	CREATE TABLE #tekst2
	(
	id		INT PRIMARY KEY,
	value	NVARCHAR(250)
	)

	INSERT INTO #tekst2 (id, value)
	SELECT InbreukKlasseID,
		   CASE @taal
			 WHEN 'FR' THEN ValueFR
			 WHEN 'EN' THEN ValueEN
			 WHEN 'DE' THEN ValueDE
			 ELSE ValueNL
		   END
	FROM dbo.BBINBRKlasse;


	-- Haal de diverse inbreukklassen op
	-- ------------------------------------------
	CREATE TABLE #tekst3
	(
	id		INT PRIMARY KEY,
	value	NVARCHAR(250)
	)

	INSERT INTO #tekst3 (id, value)
	SELECT SanctionID,
		   CASE @taal
			 WHEN 'FR' THEN SanctionFR
			 WHEN 'EN' THEN SanctionEN
			 WHEN 'DE' THEN SanctionDE
			 ELSE SanctionNL
		   END
	FROM dbo.BBINBRSanction;

	-- Haal de overtreden artikelnummer op
	-- ------------------------------------------
	CREATE TABLE #tekst4
	(
	id		INT PRIMARY KEY,
	value	NVARCHAR(MAX)
	)

	INSERT INTO #tekst4 (id, value)
	SELECT ID_ART_INBR,
		   CASE @taal
			 WHEN 'FR' THEN SCF_ART_INBR_FR
			 WHEN 'EN' THEN SCF_ART_INBR_EN
			 WHEN 'DE' THEN SCF_ART_INBR_DE
			 ELSE SCF_ART_INBR
		   END
	FROM dbo.BBINBRAR;

	-- Delen van de brief
	-- ------------------
	SELECT (SELECT value FROM #tekst WHERE id = 1) as "titel",
		   (SELECT value FROM #tekst2 WHERE id = @sanctieId) as "SanctieOmschrijving",
		   (SELECT value FROM #tekst3 WHERE id = @inbreukklasseId) as "InbreukklasseValue",
			(SELECT value FROM #tekst4 WHERE id = @infractionId) as "InbreukArtikel", 
		   @naam as "naam",
		   @adres as "adres", 
		   @postnr as "postnr", 
		   @woonpl as "woonpl", 
		   @datum as "postdatum",
           @sanctie as "sanctieValue",
           @locatie as "locatieValue",
		   @datumInbreuk as "datumInbreukValue",
	       @rijverbodVan as "datumRijverbodVan",
		   @rijverbodtot as "datumRijverbodTot",
           @geregistreerdeSnelheid as "geregistreerdeSnelheidValue",
           @toegelatenSnelheid as "toegelatenSnelheidValue",
		   @typeInfraction as "aantalInbreuken",
		   (SELECT value FROM #tekst WHERE id = 2) as "ref1",
		   (SELECT value FROM #tekst WHERE id = 4) as "ref2",
		   (SELECT value FROM #tekst WHERE id = 3) as "betreft1",
		   (SELECT value FROM #tekst WHERE id = 5) as "betreft2",
		   (SELECT value FROM #tekst WHERE id = 6) as "aanspreking",
		   (SELECT value FROM #tekst WHERE id = 7) as "p1t1",
		   @datum as "p1t2", 
		   (SELECT value FROM #tekst WHERE id = 8) as "p1t3",
		   @snelheid as "p1t4", 
		   (SELECT value FROM #tekst WHERE id = 9) as "p1t5",
		   (SELECT value FROM #tekst WHERE id = 10) as "werknemer1",
		   @werknemer as "werknemer2",
		   (SELECT value FROM #tekst WHERE id = 11) as "nrplaat1",
		   @nrplaat as "nrplaat2",
		   (SELECT value FROM #tekst WHERE (id = 12 and @max = 50) OR (id = 13 and @max != 50)) as "p2",
		   (SELECT value FROM #tekst WHERE id = 14) as "type1",
		   (SELECT value FROM #tekst WHERE (id = 23 and @recidive = 1) OR (id = 24 and @recidive = 2) OR (id = 25 and @recidive != 1 and @recidive != 2)) as "type2", 
		   (SELECT value FROM #tekst WHERE id = 15) as "sanctie1",
		   @sanctie as "sanctie2",
		   (SELECT value FROM #tekst WHERE id = 16) as "hoogachtend",
		   (SELECT value FROM #tekst WHERE id = 17) as "opsteller1",
		   (SELECT value FROM #tekst WHERE id = 18) as "opsteller2",
		   (SELECT value FROM #tekst WHERE id = 19) as "bijlage",
		   (SELECT value FROM #tekst WHERE id = 20) as "adres1",
		   (SELECT value FROM #tekst WHERE id = 21) as "adres2",
		   (SELECT value FROM #tekst WHERE id = 22) as "btw",
		   (SELECT value FROM #tekst WHERE id = 26) as "Tijdstip",
		   (SELECT value FROM #tekst WHERE id = 28) as "klasse",
		   (SELECT value FROM #tekst WHERE id = 29) as "locatie",
		   (SELECT value FROM #tekst WHERE id = 30) as "Geregisteerde Snelheid",
		   (SELECT value FROM #tekst WHERE id = 31) as "Toegelaten Snelheid",
		   (SELECT value FROM #tekst WHERE id = 32) as "Rijverbod van",
		   (SELECT value FROM #tekst WHERE id = 33) as "RijverbodTot",
		   (SELECT value FROM #tekst WHERE id = 34) as "ArtikelNrTitel";
	DROP TABLE #tekst;
	DROP TABLE #tekst2;
	DROP TABLE #tekst3;
	DROP TABLE #tekst4;
END

BEGIN
	SET NOCOUNT ON;

	DECLARE @groepId	int;
	DECLARE @actieId	int;
	DECLARE @groep		nvarchar(80);
	DECLARE @actie		nvarchar(50);
	DECLARE @maand		int;
	DECLARE @minuten	int;

	CREATE TABLE #result
	(
	  groepId	int NOT NULL,
	  actieId	int NOT NULL,
	  groep		nvarchar(80),
	  actie		nvarchar(50),
	  jan		int NOT NULL DEFAULT 0,
	  feb		int NOT NULL DEFAULT 0,
	  mrt		int NOT NULL DEFAULT 0,
	  apr		int NOT NULL DEFAULT 0,
	  mei		int NOT NULL DEFAULT 0,
	  jun		int NOT NULL DEFAULT 0,
	  jul		int NOT NULL DEFAULT 0,
	  aug		int NOT NULL DEFAULT 0,
	  sep		int NOT NULL DEFAULT 0,
	  okt		int NOT NULL DEFAULT 0,
	  nov		int NOT NULL DEFAULT 0,
	  dec		int NOT NULL DEFAULT 0,
	  tot		int,
	  perc		float,
	  PRIMARY KEY(groepId, actieId)
	);

	-- Basic Query
	-- -----------
	DECLARE c CURSOR FORWARD_ONLY FOR
		SELECT g.ActieCodeGroepId, a.ActieCodeId, g.ActieCodeGroepOmschr, a.ActieOmschr, month(v.Datum) AS "Maand", sum(d.AantalUur) * 60 + sum(d.AantalMinuten) AS "Minuten"

		FROM dbo.bvActieGroep g
		INNER JOIN dbo.bvActie a ON a.ActieCodeGroepId = g.ActieCodeGroepId
		INNER JOIN dbo.bvDagVerslagActie d ON d.ActieCodeId = a.ActieCodeId
		INNER JOIN dbo.bvDagVerslag v ON v.DagVerslagId = d.DagVerslagId

		WHERE g.ActieCodeGroepId < 11
		  AND a.InDagVerslagYN = 1
		  AND year(v.Datum) = @jaar

		GROUP BY g.ActieCodeGroepId, a.ActieCodeId, g.ActieCodeGroepOmschr, a.ActieOmschr, month(v.Datum);

	OPEN c; 

	-- Collect the Results
	-- -------------------
	FETCH NEXT FROM c INTO @groepId, @actieId, @groep, @actie, @maand, @minuten;

	WHILE @@FETCH_STATUS = 0
	BEGIN
		IF EXISTS( SELECT * FROM #result WHERE groepId = @groepId AND actieId = @actieId )
		BEGIN
			IF @maand = 1
				UPDATE #result SET jan = jan + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 2
				UPDATE #result SET feb = feb + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 3			
				UPDATE #result SET mrt = mrt + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 4			
				UPDATE #result SET apr = apr + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 5			
				UPDATE #result SET mei = mei + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 6			
				UPDATE #result SET jun = jun + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 7			
				UPDATE #result SET jul = jul + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 8			
				UPDATE #result SET aug = aug + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 9			
				UPDATE #result SET sep = sep + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 10			
				UPDATE #result SET okt = okt + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 11			
				UPDATE #result SET nov = nov + @minuten WHERE groepId = @groepId AND actieId = @actieId;
			ELSE IF @maand = 12			
				UPDATE #result SET dec = dec + @minuten WHERE groepId = @groepId AND actieId = @actieId;
		END
		ELSE
		BEGIN
			IF @maand = 1
				INSERT INTO #result (groepId, actieId, groep, actie, jan) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 2
				INSERT INTO #result (groepId, actieId, groep, actie, feb) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 3										
				INSERT INTO #result (groepId, actieId, groep, actie, mrt) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 4										
				INSERT INTO #result (groepId, actieId, groep, actie, apr) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 5										
				INSERT INTO #result (groepId, actieId, groep, actie, mei) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 6										
				INSERT INTO #result (groepId, actieId, groep, actie, jun) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 7										
				INSERT INTO #result (groepId, actieId, groep, actie, jul) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 8										
				INSERT INTO #result (groepId, actieId, groep, actie, aug) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 9										
				INSERT INTO #result (groepId, actieId, groep, actie, sep) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 10										
				INSERT INTO #result (groepId, actieId, groep, actie, okt) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 11										
				INSERT INTO #result (groepId, actieId, groep, actie, nov) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
			ELSE IF @maand = 12										
				INSERT INTO #result (groepId, actieId, groep, actie, dec) VALUES (@groepId, @actieId, @groep, @actie, @minuten);
		END;

		FETCH NEXT FROM c INTO @groepId, @actieId, @groep, @actie, @maand, @minuten;
	END;

	CLOSE c;
	DEALLOCATE c;

	-- Calculate the Year Totals
	-- -------------------------
	UPDATE #result
	SET	tot = jan + feb + mrt + apr + mei + jun + jul + aug + sep + okt + nov + dec;

	-- Calculate the Percentages on a Yearly Basis
	-- -------------------------------------------
	UPDATE #result
	SET perc = (tot * 1.0) / (SELECT sum(tot) FROM #result);

	-- And return the Result
	-- ---------------------
	SELECT groepId, actieId, groep, actie,
		   jan, feb, mrt, apr, mei, jun,
		   jul, aug, sep, okt, nov, dec, tot, perc
	FROM #result ORDER BY groepId, actieId;

	DROP TABLE #result;
END

